import React from 'react';

export default function Contact() {
  return (
    <section id="contact">
      <h2>Contact Me</h2>
      <p>If you'd like to get in touch, feel free to reach out:</p>
      <ul>
        <li>Email: <a href="mailto:me@24jaser.ru">me@24jaser.ru</a></li>
        <li>GitHub: <a href="https://github.com/puskainrestpease">puskainrestpease</a></li>
        <li>Twitch: <a href="https://www.twitch.tv/kikiqzmya">kikiqzmya</a></li>
      </ul>
    </section>
  );
}
